import {styles} from './styles/TextStyles.js'



        class Follow extends Component{

            
                    render() {
                        return(
                            <div style={styles.follow}>
                            
                              FOLLOW US ON
                              
                            
                            </div>
                            
                        );
                    }
        }
        export default Follow;
